import React from 'react';
import SHOP_DATA from './shop.data';
import { render } from 'node-sass';

class ShopPage extends React.Component {
    constructor(props) {
        super(props);

        this.state = SHOP_DATA;
    }
    render() {
        return <div>SHOP_PAGE</div>;
    }
}

export default ShopPage;
